import React, { Component } from "react";
class Settings extends Component {
  state = {};
  render() {
    let rowStyle = {
      background: "red"
    };
    return (
      <div className="container ">
        <div className="row" style={rowStyle}>
          <div className="col-md-6" />

          <div className="col-md-6">
            <label>
              Total budget
              <input
                type="text"
                name="totalBudget"
                style={{ display: "inline-box", marginRight: "16px" }}
              />
            </label>
            <button type="button" style={{ display: "inline-box" }}>
              Update
            </button>
          </div>
          <div className="col-md-2" />
        </div>
      </div>
    );
  }
}

export default Settings;
